import React from "react";
import {Appbar} from 'react-native-paper'
import { StyleSheet , Touchable} from "react-native";

function Headernav(props){

    const _handleSearcg = () => console.log('buscando');

    const _goBack = () => console.log('Went back');

    const _handleSearch = () => console.log('Searching');
  
    const _handleMore = () => console.log('Shown more');
  
    return (
      <Appbar.Header>
        <Appbar.Content title="Becas Colombia" />
        <Appbar.Content subtitle="nacionales" onPress={_handleMore}/>
        <Appbar.Content subtitle="Internacionales" onPress={_handleMore}/>
        <Appbar.Content subtitle="Registrar" onPress={_handleMore}/>
        
        <Appbar.Action icon="dots-vertical" onPress={_handleMore} />
      </Appbar.Header>
    );
  };

export default Headernav;
